import React from 'react'
import Create from './component/Create';
import {BrowserRouter, Routes, Route} from 'react-router-dom'
//import Navigation from './component/Navigation';



function App() {
  return (
    <>

      {/* <Navigation/> */}
      <BrowserRouter>
      <Routes>
      <Route path="create" element={<Create />} />

       </Routes> 
     </BrowserRouter>
    </>
  )
}

export default App
